import React from "react";
import { Container, Avatar, Typography } from "@mui/material";

const ProfilePage = () => {
  const name = "Rahul Patil";
  return (
    <Container>
      <Avatar sx={{ width: 100, height: 100 }}>
        <Typography>
          {name.split(" ")[0][0]}
          {name.split(" ")[1][0]}
        </Typography>
      </Avatar>
    </Container>
  );
};

export default ProfilePage;
